            "הערות": "מטרת הקורס - פיתוח מרכיבי הכושר\nהגופני בעצימויות שונות.\nיש להגיע לשיעור בבגדי ונעלי ספורט\nומגבת.נוכחות חובה בכל השיעורים.\n====================\nקבוצות 16,15,14,12-כושר גופני כללי\nומשחקי כדור.\nקב'32+17-היי אינטנסיטי טריינינג-\nאימון אינטרוולים בעצימות גבוהה.\nקב' 18-פונקציונלי-מעורב-אימון עצים\nבסנכרון מוזיקה.\nאולם ב'-אולם ההתעמלות הקטן בבניין\nהספורט.\n====================\nקבוצות 26-22-פיתוח כושר גופני-בחדר\nכושר - מעשי ועיוני. יש להצטייד בבגדי\nונעלי ספורט ומגבת.\nבשיעור הראשון של הסמסטר יש למלא\nהצהרת בריאות כתנאי השתתפות בקורסי\nחדר הכושר.\n====================\nהקורסים המתקיימים במתקן\"דשא סינת\" -\nהכוונה למגרש הדשא הסינתטי המקורה.\n====================\n====================================\n====================\nעל-פי הנחיות התו הסגול, על כל מתאמן\nלהציג בשער הטכניון הצהרת בריאות\nמקוונת מתוך אפליקציית הטכניון.\nכל מתאמן נדרש לסרוק,באמצעות אפליקצית\nהטכניון,את קוד התו הסגול עם הכניסה\nוהיציאה ל\/מ בניין הספורט.\nיש להקפיד על חיטוי\/שטיפת ידיים טרם\nהכניסה לשיעור ולשמור על ריחוק חברתי.\n====================\nכ\"ג=כושר גופני,כל עוד הקורס מועבר\nבמקוון.\n====================================",
