            "סילבוס": "הציון ייקבע עפ\"י מעקב והערכה במשך הסמסטר ו\/או מבחני מיומנות. הרישום לנבחרת מתבצע ע\"י המאמן לאחר בחינת רמתו הספורטיבית של המועמד במהלך שלושת השיעורים הראשונים של הסמסטר. סטודנט שיתקבל לאחת הנבחרות או קורסי המתקדמים חייב לבטל מיידית את רישומו למקצוע ספורט אחר, אחרת לא ייקלט רישומו. סטודנט אינו רשאי להירשם ליותר מאחד ממקצועות החינוך הגופני והנבחרות באותו סמסטר. נוכחות חובה בכל השיעורים. להלן פירוט הנבחרות: אתלטיקה קלה, כדור עף - אולמות וחופים, כדור סל, כדור רגל, טניס, טניס שולחן, ריצות ארוכות, כדור יד, ג'ודו, סייף, שייט, שחמט, קראטה, סלסה - להקה, שחייה, כדור מים, להקת מחול, סקווש, ניווט, אופני הרים, באולינג, גלשני מפרש, טאיקוונדו, קארטינג, דיבייט, קיאקים, סנונית, שייט.",
            "מקצועות ללא זיכוי נוסף": "394820 394808 394807 394806 394805 394804 394803 394802 394801 394800",
            "אחראים": "גב. חווה מרגלית",
            "הערות": "ההרשמה לנבחרת אך ורק אחרי בחינה!חובה\nלבטל כל רישום לקורס ספורט אחר!!!\nהרישום לנבחרת יעשה ידנית אחרי בחינה\nאצל המאמן בשבועיים הראשונים של\nהסמסטר ב ל ב ד!\n====================\nאולם ב'- אולם הספורט הקטן בבניין\nהספורט.\nהנרשמים לקבוצה 46,45,33,17-חייבים\nלהביא מחבט ושלושה כדורים.\n====================\nהנרשמים לשייט בגלשני מפרש - מקום\nההתכנסות-בית ספר ימי החוף השקט.\n====================\nקבוצה 24-שחמט-תתקיים במרכז חוגים\nאס\"ט.\n====================\nקבוצה 16-האימונים מתקיימים באולם\nחטיבת הביניים קרית חיים-רח' בן צבי 6\nקרית חיים, חיפה.\nנוכחות חובה בכל השיעורים.\n====================================\n====================\nעל-פי הנחיות התו הסגול, על כל מתאמן\nלהציג בשער הטכניון הצהרת בריאות\nמקוונת מתוך אפליקציית הטכניון.\nכל מתאמן נדרש לסרוק,באמצעות אפליקצית\nהטכניון, את קוד התו הסגול עם הכניסה\nוהיציאה ל\/מ בניין הספורט.\nיש להקפיד על חיטוי\/שטיפת ידיים טרם\nהכניסה לשיעור ולשמור על ריחוק חברתי.\n====================\n====================================\nקבוצה 19-ריצות ארוכות-תתקיים בטיילת\nבת גלים.\nקבוצה 36-אופני הרים-מפגש:תחנת המידע\nבכרמל.\nקבוצות 38,31,30,23-מתקיימות בבית ספר\nלחינוך ימי בת גלים.\nקבוצה 35-ריצת ניווט-מפגש:מדרחוב ליד\nהאמפיתיאטרון.",
